import React from 'react';
import { Card } from 'antd';
import './App.css';

function CurrencyCard(props) {
  return (
    <div className="App">
      <header className="App-header">
        <Card title={props.title}>
            <p>
            <br />
                <b>BTC:</b>

                <br />
                    <b>BUY:</b>

                    <br />
                    <b>SELL:</b>


            </p>
            <p>
            <br />
                <b>BTC:</b>

                <br />
                    <b>BUY:</b>

                    <br />
                    <b>SELL:</b>


            </p>
        </Card>
      </header>
    </div>
  );
}

export default CurrencyCard;
